                    <ListItemIcon id={"button_icons"}>
                      <IoChatbubblesSharp
                        className="icons"
                        onClick={() => navigate("/Chat")}
                      />
                    </ListItemIcon>
                  ) : index === 4 ? (
                    <ListItemIcon id={"button_icons"}>
                      <IoNotifications
                        className="icons"
                        onClick={() => navigate("/Notification")}
                      />
                    </ListItemIcon>
                  ) : null}
                </>
              </ListItem>
            ))}
          </List>
        ) : pathname === "/Order" ? (
          <List>
            {["0", "1", "2", "3", "4"].map((text, index) => (
              <ListItem button key={text} id={"button_manu"}>
                <>
                  {index === 0 ? (
                    <ListItemIcon id={"button_icons2"}>
                      <FaHome
                        className="icons"
                        onClick={() => navigate("/In")}
                      />
                    </ListItemIcon>
                  ) : index === 1 ? (
                    <ListItemIcon id={"button_icons"}>
                      <FaLanguage
                        className="icons"
                        onClick={() => navigate("/Matching")}
                      />
                    </ListItemIcon>
                  ) : index === 2 ? (
                    <ListItemIcon id={"button_icons"}>
                      <FaShoppingCart
                        className="icons"
                        onClick={() => navigate("/Order")}
                      />
                    </ListItemIcon>
                  ) : index === 3 ? (
                    <ListItemIcon id={"button_icons"}>
                      <IoChatbubblesSharp
                        className="icons"
                        onClick={() => navigate("/Chat")}
                      />
                    </ListItemIcon>
                  ) : index === 4 ? (
                    <ListItemIcon id={"button_icons"}>
                      <IoNotifications
                        className="icons"
                        onClick={() => navigate("/Notification")}
                      />
                    </ListItemIcon>
                  ) : null}
                </>
              </ListItem>
            ))}
          </List>
        ) : pathname === "/Chat" ? (
          <List>
            {["0", "1", "2", "3", "4"].map((text, index) => (
              <ListItem button key={text} id={"button_manu"}>
                <>
                  {index === 0 ? (
                    <ListItemIcon id={"button_icons2"}>
                      <FaHome
